import PropTypes from "prop-types";

const Item = (props) => {
  const { name, money } = props;
  return (
    <li>
      {name} <span>{money}</span>
    </li>
  );
};

Item.propTypes = {
  name: PropTypes.string.isRequired,
  money: PropTypes.number.isRequired,
};

export default Item;

